<style type="text/css">

#tabs {

    width: 90%;
    height: 30px;
    border-bottom: solid 1px #CCC;
    /* padding-right: 2px; */
    margin-top: 10px;
    padding-bottom: 1px;

}
a {cursor:pointer;}

#tabs li {
    float:left;
    list-style:none;
    border-top:1px solid #ccc;
    border-left:1px solid #ccc;
    border-right:1px solid #ccc;
    margin-right:5px;
    border-top-left-radius:3px;
    border-top-right-radius:3px;
      outline:none;
}

#tab1C {
    font-size: 14px !important;
}
div.line{
  transform-origin: 0 100%;
  height: 3px; /* Line width of 3 */
  background: black; /* Black fill */

}
#tabs li a {

    font-family:Arial, Helvetica, sans-serif;
    font-size: small;
    font-weight: bold;
    color: #000000;;
   padding-top: 5px;
   padding-left: 7px;
   padding-right: 7px;
    padding-bottom: 8px;
    display:block;
    background: #FFF;
    border-top-left-radius:3px;
    border-top-right-radius:3px;
    text-decoration:none;
    outline:none;

}

#tabs li a.inactive{

    padding-top: 5px;
        padding-bottom: 7px;
        padding-left: 8px;
        padding-right: 8px;
        color: #666666;
        /* background: #EEE; */
        outline: none;
        border-bottom: solid 1px #CCC;
}

#tabs li a:hover, #tabs li a.inactive:hover {


    color: #5685bc;
      outline:none;
}

#BLM {

    display: none;

}
.element {
    width: auto;
    height: 70px;
    float: left;
    margin-bottom:40px;
  text-align: center;
}
.element img {
    height: 100%;
    width: auto;
}
.distance_text {
}
img.selected {
    opacity: .5;
}
a.selected {
  background-color:#1F75CC;
  color:white;
  z-index:100;
}

.distance_text, .energy_text, .aperture_text {
    text-align: center;
        font-size: 10px;

}

.aperture_chart{

}
